import Home from './route/home/home';
import Shop from './route/shop/shop';
import {Route, Routes} from 'react-router-dom';

function App() {
  return (
    <Routes>
      <Route path='/' element={<Home />} />
      <Route path='/shop' element={<Shop />} />
    </Routes>
  );
}

export default App;
